import React from 'react';
import './home.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Home = () => {
  const createBackgroundBubbles = () => {
    const bubbles = [];
    for (let i = 0; i < 100; i++) {
      bubbles.push(React.createElement('div', {className:'bubbles'}));
    }
    return bubbles;
  }

  return (
    <div className='home'>
      {createBackgroundBubbles()}
      <ProfileImage />
      <Title />
    </div>
  );
}

export default Home;
